-- Drop Sequence/Tables section - Area of the script that drops all tables and sequences in proper order
drop table location_features_linking;
drop table reservation_details;
drop table features;
drop table reservation;
drop table room;
drop table customer_payment;
drop table customer;
drop table location;

drop sequence customer_id_seq;
drop sequence payment_id_seq;
drop sequence feature_id_seq;
drop sequence location_id_seq;
drop sequence reservation_id_seq;
drop sequence room_id_seq;


-- Create Sequence/Tables section - Area of the script that creates tables/sequences and adds constraints either via CREATE or ALTER TABLE statements
create sequence feature_id_seq start with 1 increment by 14;
create sequence location_id_seq start with 1 increment by 1;
create sequence customer_id_seq start with 100031 increment by 1;

create sequence payment_id_seq start with 1 increment by 1;
create sequence reservation_id_seq start with 1 increment by 1;
create sequence room_id_seq start with 1 increment by 1;



create table customer(
    customer_id             number          default customer_id_seq.nextval       primary key,
    first_name              varchar(100)    not null,
    last_name               varchar(100)    not null,
    email                   varchar(100)    not null        unique,
    phone                   char(12)        not null,
    address_line_1          varchar(100)    not null,
    address_line_2          varchar(100),
    city                    varchar(100)    not null,
    state                   char(2)         not null,
    zip                     char(5)         not null,
    birthdate               date,
    stay_credits_earned     number          default 0,
    stay_credits_used       number          default 0,       
    check (stay_credits_used <= stay_credits_earned),
    constraint email_length_check check (length(email) >= 7)
);

create table customer_payment(
    payment_id              number          default payment_id_seq.nextval      primary key,
    customer_id             number          not null        unique              references customer(customer_id),
    cardholder_first_name   varchar(100)    not null,
    cardholder_mid_name     varchar(100)    null,
    cardholder_last_name    varchar(100)    not null,
    card_type               char(4)         not null,
    card_number             number          not null,
    expiration_date         date            not null,
    cc_id                   number          not null,
    billing_address         varchar(100)    not null,
    billing_city            varchar(100)    not null,
    billing_state           char(2)         not null,
    billing_zip             char(5)         not null
);

create table location(
    location_id             number          default location_id_seq.nextval       primary key,
    location_name           varchar(100)    not null        unique,
    address                 varchar(100)    not null,
    city                    varchar(100)    not null,
    state                   char(2)         not null,
    zip                     char(5)         not null,
    phone                   char(12)        not null,
    url                     varchar(100)    not null
);

create table features(
    feature_id              number          default feature_id_seq.nextval       primary key,
    feature_name            varchar(100)    not null                             unique
);

create table location_features_linking(
    location_id             number          not null        references location(location_id),
    feature_id              number          not null        references features(feature_id),
    constraint location_features_pk                         primary key(location_id, feature_id)
);

create table reservation(
    reservation_id          number          default reservation_id_seq.nextval    primary key,
    customer_id             number          references customer(customer_id),
    location_id             number          references location(location_id),
    confirmation_nbr        char(8)         not null                              unique,
    date_created            date            default sysdate,
    check_in_date           date            not null,
    check_out_date          date,
    status                  char(1)         not null        check (status in ('U', 'I', 'C', 'N', 'R')),
    number_of_guests        number          not null,
    reservation_total       number          not null,
    discount_code           number,
    customer_rating         number,
    notes                   varchar(100)
);

create table room(
    room_id                 number          default room_id_seq.nextval       primary key,
    location_id             number          not null                          references location(location_id),
    room_number             number          not null,
    floor                   number          not null,
    room_type               char(1)         not null                          check (room_type in ('D', 'Q', 'K', 'S', 'C')),
    square_footage          number          not null,
    max_people              number          not null,
    weekday_rate            number          not null,
    weekend_rate            number          not null,
    constraint location_room_unique unique (location_id, room_number)
);

create table reservation_details(
    reservation_id          number          not null        references reservation(reservation_id),
    room_id                 number          not null        references room(room_id),
    constraint reservation_room_pk                          primary key(reservation_id, room_id)
);

commit;

-- Insert Data section - Area of the script that inserts data into the tables using �INSERT INTO�
commit;

