-- Create Index section � After you seed data, add in indexes for the database to optimize performance 
CREATE INDEX Reservation_Customer_ID_idx  
ON Reservation (Customer_ID);

CREATE INDEX Reservation_Location_ID_idx  
ON Reservation (Location_ID);

CREATE INDEX Room_Location_ID_idx  
ON Room (Location_ID);

CREATE INDEX Room_Weekday_Rate_idx  
ON Room (Weekday_Rate);

CREATE INDEX Room_Weekend_Rate_idx
ON Room (Weekend_Rate);

commit;


